- input: "TEXT\x1CC00432260\x1C.TEXT\x1C\x1CF3XA\x1CThe follwing information is in
    response to a letter dated 5/22/09.: Item 1- The calendar year to date totals
    for lines 11(a)(i),11(ai)(ii), 11(c) are correct after uploading an earlier amended
    report.  Item 2: According to the letter sent on 5/22/09, the FECFile software
    discloses the calendar-year-to-date-per election for office sought for Steven
    Pearce (from Schedule E) to be  $5,382.55; however, the FEC calcualtions disclose
    the amount to be $746.23.  Per  our phone conversation with Ms. Sinram, we believe
    the $5,382.55 total to be correct, as in addition to the $746.23 reported on this
    report, the following Independent Expenditures were reported on Schedule E of
    the July Monthly Report (covering dates 6/1/08-6/30/08) all supporting Steven
    Pearce for the General Election in 2008: 6/4/08 for $75.96, 6/25/08 for $804.94
    and 6/25/08 $3,755.42 for a grand total of $5,382.55. In response to Item 3, the
    aggregate y-t-d totals in question refer to the donor's giving to CFG PAC, not
    the candidate/committee listed in the memo entry.  We cannot adjust this field
    and all data was imported according to the FECfile software instructions.  Item
    4: The data was re-imported to correct the discrepency.\n"
